import React from "react";
import "./ExpensesList.css";
import ExpenseItem from "./ExpenseItem";
const ExpensesList = (props) => {
  return (
    <div>
      {props.items.length === 0 ? (
        <p>No Expenses Found.</p>
      ) : (
        props.items.map((exp) => (
          <ExpenseItem
            key={exp.id}
            title={exp.title}
            amount={exp.amount}
            date={exp.date}
          />
        ))
      )}
    </div>
  );
};

export default ExpensesList;
